import React from 'react';

const left = (props) => {
    return (
        <>
            <div className="d-none d-md-block px-2 py-3"
                style={{ position: 'fixed', width: '19%', height: '100%', top: 52, left: 76, backgroundColor: '#f8f9fa' }} >
               
                {props.children}
            </div >
        </>
    );
}

export default left;
